import React from 'react';



const style = {
    color: '#ffffff',
    backgroundImage: `url(${temple})`,
    backgroundSize: '100%',
    backgroundRepeat: 'no-repeat',
    minHeight: '410px',
};

export default function Header() {
    return (
        <div style={style}>
            <div style={headerStyle}>Experience<br></br>the new museum.</div> 
        </div>
    );
}
